  [],\n\t\"revision_timestamp\": \"2015-05-07T14:28:42.367324\",\n\t\"name\": \"integrated-mmic-for-phase-locked-oscillators-and-frequency-synthesizers-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Microwave Monolithic Integrated Circuits
  (MMIC) provide the technology base for miniaturization of microwave payloads in
  spacecraft.  While MMIC chips are widely available for amplifiers, switches, converters,
  etc., there is only a limited supplier base for MMIC signal sources.  Hittite has
  recognized the need and introduced a family of MMICs for phase-locking loops and
  phase-locked oscillators.  Hittite's MMICs include; VCOs, frequency multipliers
  and dividers, programmable counters, phase-frequency detectors, and loop amplifiers.
  \ This proposal describes and approach of integrating many of those MMIC parts into
  a single chip for frequency synthesis without VCOs.  This choice of the scale of
  integration will support the design architecture for frequency synthesizers with
  versatility of a wide range of operating frequencies. The selected design goals
  will allow signal generation from 100 MHz to 12 GHz.  The phase noise floor of the
  synthesizer is expected to be ?150 dBC/Hz at 100 MHz offset.  Design approaches
  for all component parts of the proposed MMIC are presented.\",\n\t\"license_title\":
